#import "XGPSadTim.h"

NSString * const kXGPSadTimImage = @"<style>* {margin:0;padding:0;}</style><img src=\"data:image/jpeg;base64,\" alt=\"Sad Tim Cook\">";

@implementation XGPSadTim

+ (WKWebView *)sadTimView
{
    WKWebView *wv = [[WKWebView alloc] initWithFrame:CGRectMake(0, 0, 500, 250) configuration:[WKWebViewConfiguration new]];

    [wv loadHTMLString:kXGPSadTimImage baseURL:nil];

    return wv;
}

@end